import axios from 'axios';
import * as React from 'react'

import EmployeeService from '../services/EmployeeService';
export default class Employee extends React.Component<any, any> {
    constructor(props: any) {
        super(props);

        this.state = {
            data: null,
            isLoading: false,
            employees:null,
        };
    };
    componentDidMount() {
      
    //     this.setState({ isLoading: true });
    //     EmployeeService.getEmployeeList().
    //     then(response => response.json())
    //    .then(data => this.setState({ employees: data }));
    const token=localStorage.getItem('access_token');
      this.setState({isLoading:true});

    fetch("http://localhost:8090/api/Employee/GetEmployees",{
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
          'Authorization': `Bearer ${token?.replace(/["]+/g, '')}`,
          'Accept': 'application/json',
      },
      redirect:'follow'
    })
    .then(response => response.json())
    .then(data => this.setState({ employees: data ,isLoading:false}))
    .catch(error => console.log('Authorization failed : ' + error.message));
   
  
    }
    render() {
        const { employees, isLoading } = this.state;
        if (isLoading) {
            return <p>Loading ...</p>;
        }
        return (
            <div>
                <a>{employees.length}</a>
                <ul>
                     {employees.map((emp: { employeeId: React.Key | null | undefined; compantName: string | undefined; month: boolean | React.ReactChild | React.ReactFragment | React.ReactPortal | null | undefined; }) =>
                        <li key={emp.employeeId}>
                            <a href={emp.compantName}>
                                    {emp.month}</a>
                        </li>
                    )} 
                </ul>
            </div>
        )
    }

}
